import styled, { css } from "styled-components";
import { UserOutlined } from "@ant-design/icons";

export const Profile = styled.div`
  width: ${(props) => props.width};
  border-radius: 50%;
  img {
    width: 100%;
  }
`;

export const NoImage = styled(UserOutlined)`
  border-radius: 50%;
  width: ${(props) => props.width};
  cursor: pointer;
`;
